using AlgorithmsLeetCodeCSharp.Concurency.MediumProblems;
using NUnit.Framework;
using System;
using System.Threading.Tasks;

namespace AlgorithmsLeetCodeCSharpTests.Conrucency.MediumProblems
{
	public class FizzBuzzTests
	{
		[TestCase("",
			10000, 1000)]
		[TestCase("",
			1000, 20)]
		[TestCase("",
			100, 10)]
		[TestCase("12fizz4buzzfizz78fizzbuzz11fizz1314fizzbuzz1617fizz19buzzfizz2223fizzbuzz26fizz2829fizzbuzz", 30, 2)]
		[TestCase("12fizz4buzzfizz78fizzbuzz11fizz1314fizzbuzz", 15, 1)]
		[TestCase("12fizz4buzzfizz78fizzbuzz", 10, 1)]
		[TestCase("12fizz", 3, 1)]
		[TestCase("1", 1, 1)]
		public void Check_FizzBuzzOld_4ThreadsCase(string result, int n, int miliseconds)
		{
			var watch = System.Diagnostics.Stopwatch.StartNew();
			string wholeString = string.Empty;
			var fizzBuzz = new FizzBuzzOld(n);
			var fizzAction = new Action(() => wholeString = string.Concat(wholeString, "fizz"));
			var buzzAction = new Action(() => wholeString = string.Concat(wholeString, "buzz"));
			var fizzbuzzAction = new Action(() => wholeString = string.Concat(wholeString, "fizzbuzz"));
			var numberAction = new Action<int>(x => wholeString = string.Concat(wholeString, x.ToString()));
			var firstTask = new Task(() => fizzBuzz.Fizz(fizzAction));
			var secondTask = new Task(() => fizzBuzz.Buzz(buzzAction));
			var thirdTask = new Task(() => fizzBuzz.Fizzbuzz(fizzbuzzAction));
			var fourthTask = new Task(() => fizzBuzz.Number(numberAction));

			Parallel.Invoke
			(
				() => fizzBuzz.Fizz(fizzAction),
				() => fizzBuzz.Buzz(buzzAction),
				() => fizzBuzz.Fizzbuzz(fizzbuzzAction),
				() => fizzBuzz.Number(numberAction)
			);
			watch.Stop();
			Assert.AreEqual(result, wholeString);
			Assert.IsTrue(watch.ElapsedMilliseconds < miliseconds);
		}

		[TestCase("",
			10000, 600)]
		[TestCase("",
			1000, 20)]
		[TestCase("",
			100, 10)]
		[TestCase("12fizz4buzzfizz78fizzbuzz11fizz1314fizzbuzz1617fizz19buzzfizz2223fizzbuzz26fizz2829fizzbuzz", 30, 2)]
